import { HeaderBox, Login, Logo, Title } from "../style";
import { SearchBox } from "./SearchBox";

export const Header = ({ filter, setFilter }: any) => {
  return (
    <HeaderBox>
      <SearchBox filter={filter} setFilter={setFilter}></SearchBox>
      <Logo>
        <img
          src={require("../locales/images/logo.png")}
          alt="Ni ma loga"
          style={{ width: "100%", height: "100%" }}
        ></img>
      </Logo>
      <Title></Title>
      <Login></Login>
    </HeaderBox>
  );
};
